<script type="text/javascript">
$(document).ready(function(){
	$(".ktTree1").click(function(){
		$(".treeJia").html("+");
		if ($(this).next().next().hasClass("ktTreeOn")) {
			$(".inital").removeClass("ktTreeOn");
			$(this).next().html("+");
			$(this).next().next().removeClass("ktTreeOn");
		}
		else{
			$(".inital").removeClass("ktTreeOn");
			$(this).next().html("-");
			$(this).next().next().addClass("ktTreeOn");
		}
	});
	$(".ktTree2").click(function(){
		$(".ktTree2").removeClass("ktselect");
		$(this).addClass("ktselect");
	});
});

<script type="text/javascript">
$(document).ready(function(){
	$(".freezingTitle").click(function(){
		$(".freezingTitle").removeClass("freezingSelect");
		$(".freezingImg").css("display","none");
		var num = $(this).attr("data-html");
		$(this).addClass("freezingSelect");
		$("#freezingImg" + num).css("display","block");
		var chartNum = num - 1;
        if(chartNum == 0){
            var chart = $('#container').highcharts();
            //alert(chartNum);
            chart.reflow();
        }else{
            var chart = $('#container' + chartNum).highcharts();
            //alert(chartNum);
            chart.reflow();
        }
	});
});
</script>
